import React from 'react'
import { Link,useNavigate } from 'react-router-dom'
import { Navbar,Nav,Container,Dropdown, DropdownToggle } from 'react-bootstrap'
import './navbar.css'

function Navbars() {
    const navigate=useNavigate()

  // const loginhandle= () =>
  // {
  //   // alert('login sucess........')
  //   navigate('/loginuser')
  // }



  return (
    <>

    <Navbar bg="dark" data-bs-theme="dark">
        <Container height={33}>
        <div className='nav-content'>
          <Navbar.Brand href="#home"><img src={process} /></Navbar.Brand>
          <Nav className="nav-item">
            <Link to="/">Home</Link>
            <Link to='/contact'>Contact US</Link>
            <Link to="/about">About</Link>
          </Nav>
          </div>
        </Container>

        {/* <Button>Signup</Button>&nbsp;&nbsp;
        <Button onClick={loginhandle}>Login</Button> */}


<Dropdown style={{color:'white', marginRight:'40px'}}>
                    <Dropdown.Toggle >
                    &#9776;
                    </Dropdown.Toggle>
                    <Dropdown.Menu>
                      <Dropdown.Item as={Link} to='/fcxf'> 
                      Signup
                      </Dropdown.Item>
                      <Dropdown.Item as={Link} to="/loginuser">
                     Login
                      </Dropdown.Item>
                    </Dropdown.Menu>
</Dropdown>



      </Navbar>

    </>
  )
}

export default Navbars
